import React from "react";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import { Link } from "react-router-dom";
import Modal from 'react-bootstrap/Modal';

// bg="primary" data-bs-theme="dark"

const Header = (props) => { 
  let st = {
    background : '#0e8388',
    color: 'white'
  };

  const [modalShow, setModalShow] = React.useState(false);

  function MyVerticallyCenteredModal(props) {
    return (
      <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Modal heading
          </Modal.Title>
        </Modal.Header>
        <Modal.Body className="bg-white">
          <h4>Centered Modal</h4>
          <p>
            Cras mattis consectetur purus sit amet fermentum. Cras justo odio,
            dapibus ac facilisis in, egestas eget quam. Morbi leo risus, porta ac
            consectetur ac, vestibulum at eros.
          </p>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={props.onHide}>Close</Button>
        </Modal.Footer>
      </Modal>
    );
  }

  const logout = (e) => {
    e.preventDefault();
    sessionStorage.clear();
    window.location.replace("");
  }

//   const modal = (e) => {
//     e.preventDefault();

//     var modal = document.getElementById("myModal");

// // Get the button that opens the modal
// var btn = document.getElementById("myBtn");

// // Get the <span> element that closes the modal
// var span = document.getElementsByClassName("close")[0];

// // When the user clicks the button, open the modal 
// btn.onclick = function() {
//   modal.style.display = "block";
// }

// // When the user clicks on <span> (x), close the modal
// span.onclick = function() {
//   modal.style.display = "none";
// }

// // When the user clicks anywhere outside of the modal, close it
// window.onclick = function(event) {
//   if (event.target === modal) {
//     modal.style.display = "none";
//   }
// }
//   }

  return (
  <>
    <Navbar expand="lg" style={st} className="">
      <Container fluid>
      <Nav className="me-auto">
        <Navbar.Brand><h3 className="logoHeading">Object Locator</h3></Navbar.Brand>
        </Nav>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="ms-auto my-2 my-lg-0"
            style={{ maxHeight: '100px', marginRight: '4%'}}
            navbarScroll
          >
            <Link to="/" className="navButton">Home</Link>
            {/* <Link to="/Add" className="navButton">Add</Link> */}
            <Button variant="primary" onClick={() => setModalShow(true)}>
        Add
      </Button>

      <MyVerticallyCenteredModal
        show={modalShow}
        onHide={() => setModalShow(false)}
      />
            {/* <button id="myBtn" onClick={modal}>Open Modal</button>

            <div id="myModal" class="modal">

              <div className="modal-content">
                <div className="modal-header">
                  <span className="close">&times;</span>
                  <h2>Modal Header</h2>
                </div>
                <div className="modal-body">
                  <p>Some text in the Modal Body</p>
                  <p>Some other text...</p>
                </div>
                <div className="modal-footer">
                  <h3>Modal Footer</h3>
                </div>
              </div>

            </div> */}


          </Nav>
          <Form className="d-flex me-3">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-light">Search</Button>
          </Form>
              <NavDropdown title="Link" id="navbarScrollingDropdown">
                     
              <NavDropdown.Item as={Link} to="/MyProfile">My Profile</NavDropdown.Item>

              <NavDropdown.Item as={Link} to="/" onClick={logout}>Logout</NavDropdown.Item>

            </NavDropdown>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </>
  );
};

export default Header;
